import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Widget } from 'react-chat-widget';
import 'react-chat-widget/lib/styles.css'; // Import the default styles from the react-chat-widget library
import avatar from '../assets/chatbot-avatar.png'; // Ensure the correct path for the avatar image

const Chatbot = () => {
  const [messages, setMessages] = useState([]);
  const [isFirstMessage, setIsFirstMessage] = useState(true);

  // Function to handle new user messages
  const handleNewUserMessage = (message) => {
    console.log(`New message incoming: ${message}`);

    // Add the user's message to the chat (for internal state)
    setMessages((prevMessages) => [
      ...prevMessages,
      { user: true, text: message },
    ]);

    // Send the message to the Flask backend
    axios
      .get('http://localhost:5002/get', { params: { msg: message } })
      .then((response) => {
        const botMessage = response.data;
        setMessages((prevMessages) => [
          ...prevMessages,
          { user: false, text: botMessage },
        ]);
      })
      .catch((error) => {
        console.error('Error getting response from the bot:', error);
        setMessages((prevMessages) => [
          ...prevMessages,
          { user: false, text: 'Sorry, something went wrong.' },
        ]);
      });
  };

  // Render initial bot messages
  useEffect(() => {
    if (isFirstMessage) {
      setMessages([
        { user: false, text: "Hello, my name is RoboDoc, and I will be happy to help diagnose your disease." },
        { user: false, text: "To start, we need to ask some basic questions. Type 'OK' to continue." },
      ]);
      setIsFirstMessage(false);
    }
  }, [isFirstMessage]);

  return (
    <div className="chat-container">
      {/* Chat Widget */}
      <Widget
        handleNewUserMessage={handleNewUserMessage}
        profileAvatar={avatar}  // Add custom avatar image for the bot
        title="AI Healthcare Assistant"
        subtitle="How can I help you today?"
        messages={messages}  // Pass custom messages to the widget
      />
    </div>
  );
};

export default Chatbot;
